import React, { Component } from 'react'
import './css/reset.css'
import './App.css'

export default class App extends Component {

    constructor() {
        super()
        this.state = {
            src: [
                "./img/img(6).png"
            ]
        }
    }

    render() {
        return (
            <ul className='App'>
                niahao
                <li><img src="./img/img(6).png" alt='' /></li>
                <li><img src="../public/img/img (1).png" alt='' /></li>
                <li><img src="../public/img/img (2).png" alt='' /></li>
            </ul>
        )
    }
}
